import React, { Component } from 'react'

class Category extends Component {
  constructor() {
    super()
    this.state={
      types: ['Album']
    }
  }

  render() {
    return(
      <div className="section">
        <div className="category_cover">
          <ul>
            {this.state.types.map((item, index) => {
              return(
                <div key={index}>
                  <li>{item}</li>
                </div>
              )
            })}
          </ul>
        </div>
      </div>
    )
  }
}

export default Category
